import React from "react";
import {
  List,
  Datagrid,
  TextField,
  EditButton,
  DeleteButton,
  DateField,
} from "react-admin";

const AccessList = (props) => {
  return (
    <List {...props}>
      <Datagrid rowClick="show">
        <TextField source="email" label="Email" />
        <TextField source="role" label="Role" />
      </Datagrid>
    </List>
  );
};

export default AccessList;
